import "components/Navbar.css";

function Navbar() {
    return (<div className="Navbar">
        <div className="leftSide">
            <div className="links">
                <a href="/home">Home</a>
                <a href="/Events">Events</a>
                <a href="/home">Home</a>
                <a href="/Events">Events</a>
                <a href="/home">Home</a>
                <a href="/Events">Events</a>
